export const SET_AVAILABLE_TRAININGS = '[Training] Set Available Trainings';
export const SET_FINISHED_TRAININGS = '[Training] Set Finished Trainings';
export const START_TRAINING = '[Training] Start Training';
export const STOP_TRAINING = '[Training] Stop Training';
export class SetAvailableTrainings {
  constructor(payload) {
    this.payload = payload;
    this.type = SET_AVAILABLE_TRAININGS;
  }

}
export class SetFinishedTrainings {
  constructor(payload) {
    this.payload = payload;
    this.type = SET_FINISHED_TRAININGS;
  }

}
export class StartTraining {
  constructor(payload) {
    this.payload = payload;
    this.type = START_TRAINING;
  }

}
export class StopTraining {
  constructor() {
    this.type = STOP_TRAINING;
  }

}
